(8116, 102, 'New annual register or', 'The New annual register, or General repository of history, politics, and literature, for the year ...', NULL, NULL, NULL, 'Printed for G. Robinson, Pater-noster-Row,', 'London [England]', 1780, NULL, NULL, '', NULL, 'eng', 'http://catalog.hathitrust.org/Record/008698668', 'Description based on: [Vol. 2] 1781.Includes: history, biography, political activity during the year, Parliamentary papers, new books published, poetry, news of North America, East India, Great Britain, Ireland, and Western Europe.Topical divisions have continuous pagination and register, with caption titles on first page of text.Sections with half-titles have added caption titles, separate pagination and register.Imprint varies; from title pages for 1785-1799 volumes: Printed for G. G. J. and J. Robinson; from 1800- : Printed by S. Hamilton, for G. and J. Robinson.Imprint includes year of publication.Below title of v. 2 (1781): "To which is prefixed, a short view of the state of knowledge, literature, and taste, in this country, from the death of Queen Anne, to the death of King George II." These notes vary with each volume.William Godwin wrote the British foreign history section of the New Annual Register from 1784-1791 (cf. DNB).Planned and founded by Andrew Kippis as a competitor to Dodsley''s Annual Register (cf. DNB).Restricted access;ESTCMode of access: Internet.The Pforzheimer Collection holds vols. for 1780, 1782-87, 1791-92 and 1794.'),
