(9717, 100, 'guide to the middle English', 'A guide to the middle English metrical romances dealing with English and Germanic legends, and with the cycles of Charlemagne and of Arthur;', NULL, 'Yale studies in English,', NULL, 'H. Holt and company,', 'New York', 1901, 'IX', '2 p. l., xxiv, 232 p.', '1901', NULL, 'eng', 'http://catalog.hathitrust.org/Record/001907529', 'Each romance is treated under the captions 1. Subject. 2. Specimen. 3. Story. 4. Origin. 5. Metre. 6. Dialect. 7. Date. 8. Author. 9. Bibliography."The plan of this book was suggested by the bibliography of the middle English verse-romances in Körting''s ''Grundriss der geschichte der englischen literatur.'' I have added to and expanded Körting''s plan ..."--Pref.Books and journals most frequently referred to.--Introduction.--English and Germanic legends. I. King Horn. II. Horn Childe and maiden Rimnild. III. Havelok the Dane. IV. Guy of Warwick.--V. Athelston. VI. Sir Beues of Hamtoun. VII. William of Palerne.--The Charlemagne legends. VIII. the sowdone of Babylone. IX. Sir Firumbras. X. Roiland and Vernagu. XI. The sege of Melayne. XII. Otuel. XIII. Duke Rowlande and Sir Otuell of Spayne. XIV. The song of Roland. XV. The taill of Rauf Coil ear.--The Aruthurian legends. XVI. Sir Tristrem. XVII. Joseph of Arimathie. XVIII. The Holy Grail. XIX. Arthour and Merlin. XX. Merlin. XXI. Sir Perceval of Galles. XXII. Libeaus Desconus. XXIII. Sir Launfal. XXIV. Ywain and Gawain. XXV. Sir Gawain and the Green Knight. XXVI. Golgarus and Gawain. XXVII. The aunters of Arthur. XXVIII. The avowynge of King Arthur. XXIX. Morte Arthure. XXX. Arthur. XXXI. Lancelot of the Laik. XXXII. Le morte Arthur. XXXIII. Romance poems on Gawain: 1. The Grene knight. 2. The Turk and Gowin. 3. The jest of Syr Gawayne. 4. Syr Gawayne and the Carle of Carlile. 5. The weddynge of Syr Gawayne.--Appendix A. Concerning the origin of the Arthurian legends.--Appendix B. Two more Germanic legends.--Index.--Additions and corrections.Mode of access: Internet.'),
